for i in range(len(a)):
    b=a[i]
    b64_str=b.encode("ascii")
    print(f"b64_str={b64_str}")
    b64_bytes = base64.b64decode(b64_str)
    print(f"b64_bytes={b64_bytes}")
    try:
        Write(f"{o}.png",b64_bytes)
        print("Written to as png bef decode_str")
    except:
        decode_str = b64_bytes.decode('ascii')
        print(f"decode_str={decode_str}")
        try:
            Write(f"{o}.png",decode_str)
            print("written after decode")
        except:
            Write(f"{o}.txt",decode_str)
            print("written as txt")
    o+=1

